    false,nt"url": null,nt"notes": "A number of ground nesting bird species
    inhabit Parker River National Wildlife Refuge, including least and common terns,
    piping plovers, and black ducks. Predation is always an important concern for the
    management of ground nesting birds. Management becomes more important when predator
    populations become excessively large, when a high level of predation is observed,
    or when predation is observed on threatened and endangered species.  The objectives
    of this Animal Control Plan are to: contribute to the widest diversity of habitats,
    maintain population levels of wildlife species that are compatible with Refuge objectives,
    contribute to the attainment of national wildlife objectives, maintain healthy populations
    of ground nesting bird species, ensure that conflicts between endangered/threatened
    species and other wildlife management or public use programs are resolved in favor
    of the endangered/threatened species, minimize wildlife damage to facilities, and
    minimize the occurrence of high population densities of wildlife species which have
    the potential to transmit contagious diseases.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
